    margin-top: 0vh;

    }
    .designsp{
         font-size: 2vw;
    }
}
.footer {
    background-color: #000;
    font-family: 'Oregano', cursive;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    font-size: 6vw;
    color: #ffffff;
    .footerh{
         font-size: 8vw;
    }
    .footerp{
