sources.css\\_navigator.scss:
.navigator{
    position: sticky;
    background-color: #c4c4c4;
    height: 30vh;
    .header{
        top: 20%;
        left: 20%;
    }
}
.navbar{
    margin-left: 95vw;
    top: 5;
    width: 5rem;
    height: 5vh;
    position: fixed;
    background-color: wheat;

    transition: width 400ms ease;
    transform: translateX(-100%);
}

.navbar_nav{
    list-style: none;
    padding: 0;
    margin: 0;
    display: flex;
    flex-direction: column;
    align-items: center;
}

.trigger{
    display: block;
}
.trigger:hover{
    display: none;
}

.nav_item{
    width: 100%;
}

.nav_item:last-child{
    margin-top: auto;
}

.link_text{
    color: black;
    display: none;
}

.navbar:hover{
    height: 15vh;
    width: 10rem;
}
.navbar:hover .link_text{
    display: block;
}

